k.com/7cloudsmusic\nhttps://facebook.com/7cloudsofficial\nhttps://discord.com/invite/d5Arh8Y\nhttps://twitter.com/7cloudsmusic\nhttps://instagram.com/7clouds\nhttps://tiktok.com/@7clouds\nhttps://7clouds.org\n\n.........\n Lyrics: The Script - The Man Who Can't Be Moved\n\n[Verse 1]\nGoing back to the corner where I first saw you\nGonna camp in my sleeping bag, I'm not gonna move\nGot some words on cardboard, got your picture in my hand\nSaying, \"If you see this girl, can you tell her where I am?\"\nSome try to hand me money, they don't understand\nI'm not broke, I'm just a broken-hearted man\nI know it makes no sense, what else can I do?\nAnd how can I move on when I'm still in love with you?\n\n[Chorus]\n'Cause if one day you wake up, and find that you're missing me\nAnd your heart starts to wonder where on this Earth I could be\nThinking maybe you'll come back here to the place that we'd meet\nAnd you'll see me waiting for you, on the corner of the street\nSo I'm not moving\nI'm not moving\n\n[Verse 2]\nPoliceman says, \"Son, you can't stay here\"\nI say, \"There's someone I'm waiting for\nIf it's a day, a month, a year\"\nGotta stand my ground, even if it rains or snows\nIf she changes her mind, this is the first place she will go\n\n[Chorus]\n'Cause if one day you wake up, and find that you're missing me\nAnd your heart starts to wonder where on this Earth I could be\nThinking maybe you'll come back here to the place that we'd meet\nAnd you'll see me waiting for you, on the corner of the street\nSo I'm not moving\nI'm not moving\nI'm not moving\nI'm not moving\n\n[Bridge]\nPeople talk about the guy who's waiting on a girl, oh\nThere are no holes in his shoes, but a big hole in his world, mmm\nAnd maybe I'll get famous as the man who can't be moved\nAnd maybe you won't mean to, but you'll see me on the news\nAnd you'll come running to the corner 'cause you know it's just for you\nI'm the man who can't be moved\nI'm the man who can't be moved\n\n[Chorus]\n'Cause : The Script - The Man Who Can't Be Moved\n\n[Verse 1]\nGoing back to the corner where I first saw you\nGonna camp in my sleeping bag, I'm not gonna move\nGot some words on cardboard, got your picture in my hand\nSaying, \"If you see this girl, can you tell her where I am?\"\nSome try to hand me money, they don't understand\nI'm not broke, I'm just a broken-hearted man\nI know it makes no sense, what else can I do?\nAnd how can I move on when I'm still in love with you?\n\n[Chorus]\n'Cause if one day you wake up, and find that you're missing me\nAnd your heart starts to wonder where on this Earth I could be\nThinking maybe you'll come back here to the place that we'd meet\nAnd you'll see me waiting for you, on the corner of the street\nSo I'm not moving\nI'm not moving\n\n[Verse 2]\nPoliceman says, \"Son, you can't stay here\"\nI say, \"There's someone I'm waiting for\nIf it's a day, a month, a year\"\nGotta stand my ground, even if it rains or snows\nIf she changes her mind, this is the first place she will go\n\n[Chorus]\n'Cause if one day you wake up, and find that you're missing me\nAnd your heart starts to wonder where on this Earth I could be\nThinking maybe you'll come back here to the place that we'd meet\nAnd you'll see me waiting for you, on the corner of the street\nSo I'm not moving\nI'm not moving\nI'm not moving\nI'm not moving\n\n[Bridge]\nPeople talk about the guy who's waiting on a girl, oh\nThere are no holes in his shoes, but a big hole in his world, mmm\nAnd maybe I'll get famous as the man who can't be moved\nAnd maybe you won't mean to, but you'll see me on the news\nAnd you'll come running to the corner 'cause you know it's just for you\nI'm the man who can't be moved\nI'm the man who can't be moved\n\n[Chorus]\n'Cause if one day you wake up, and find that you're missing me (find you're missing me)\nAnd your heart starts to wonder where on this Earth I could be (oh, where on Earth I could be)\nThinking maybe you'll come back here to the place that we'd meet (to the place that we'd meet, oh, oh)\nAnd you'll see me waiting for you, on the corner of the street (on the corner of the street)\nSo I'm not moving\n\n[Chorus]\n'Cause if one day you wake up, and find that you're missing me (I'm not moving)\nAnd your heart starts to wonder where on this Earth I could be (I'm not moving)\nThinking maybe you'll come back here to the place that we'd meet (I'm not moving)\nAnd you'll see me waiting for you, on the corner of the street\n\n[Outro]\nGoing back to the corner\nWhere I first saw you\nGonna camp in my sleeping bag\nI'm not gonna move\n\n.........\n Contact / Demo Submissions: contact@7clouds.org\n.........\n Demos / Music Submissions: https://7clouds.portal.district.biz\n.........\n Licensing / Sync Requests for 7clouds Releases: licensing@7clouds.org\n.........\n\n#thescript #themanwhocantbemoved #lyrics #7clouds","commandRuns":[{"startIndex":53,"length":23,"onTap":{"innertubeCommand":{"clickTrackingParams":"CM8FEM2rARgBIhMIv52Zs7nzjgMVz_1PCB3sNCpoSPqGqOTx0vO5XA==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa0NCY19Pcm4zdU8zOUUxdnhvZjhwSUtoT01xQXxBQ3Jtc0tsenBlWjJzT1dremlVUVVDWmFaNUFrTlhnU0E1c1B2UUx4MFRqZjB6dTZtM3IzWmllekJyTnR6TW1nM0JXem15dU9wdkJ1YmNPNkFCSjhPUGVBODJRbmRpOGRrRVg1SGlmYjg2eFQ0QUU0M0pSTmp1Yw\u0026q=http%3A%2F%2Fspoti.fi%2F2SJsUcZ\u0026v=XHPOlxyKA3o","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa0NCY19Pcm4zdU8zOUUxdnhvZjhwSUtoT01xQXxBQ3Jtc0tsenBlWjJzT1dremlVUVVDWmFaNUFrTlhnU0E1c1B2UUx4MFRqZjB6dTZtM3IzWmllekJyTnR6TW1nM0JXem15dU9wdkJ1YmNPNkFCSjhPUGVBODJRbmRpOGRrRVg1SGlmYjg2eFQ0QUU0M0pSTmp1Yw\u0026q=http%3A%2F%2Fspoti.fi%2F2SJsUcZ\u0026v=XHPOlxyKA3o","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":151,"length":36,"onTap":{"innertubeCommand":{"clickTrackingParams":"CM8FEM2rARgBIhMIv52Zs7nzj Text":"Show less"},"attributedDescriptionBodyText":{"content":" Follow the official 7clouds playlist on Spotify : http://spoti.fi/2SJsUcZ\n The Script - The Man Who Can't Be Moved (Lyrics)\n Download / Stream: https://smarturl.it/TheScriptSpotify\n Turn on notifications to stay updated with new uploads!\n\n Follow our Spotify playlists: http://bit.ly/7cloudsSpotify\n\n The Script:\n/thescriptofficial\n/thescripttok\n/thescript\n/thescript\nhttps://thescriptmusic.com\n\n 7clouds:\nhttps://open.spotify.com/user/7clouds...\n/7cloudsmusic\nhttps://audiomack.com/7cloudsmusic\n/7cloudsofficial\n/discord\n/7cloudsmusic\n/7clouds\n/7clouds\nhttps://7clouds.org\n\n.........\n Lyrics: The Script - The Man Who Can't Be Moved\n\n[Verse 1]\nGoing back to the corner where I first saw you\nGonna camp in my sleeping bag, I'm not gonna move\nGot some words on cardboard, got your picture in my hand\nSaying, \"If you see this girl, can you tell her where I am?\"\nSome try to hand me money, they don't understand\nI'm not broke, I'm just a broken-hearted man\nI know it makes no sense, what else can I do?\nAnd how can I move on when I'm still in love with you?\n\n[Chorus]\n'Cause if one day you wake up, and find that you're missing me\nAnd your heart starts to wonder where on this Earth I could be\nThinking maybe you'll come back here to the place that we'd meet\nAnd you'll see me waiting for you, on the corner of the street\nSo I'm not moving\nI'm not moving\n\n[Verse 2]\nPoliceman says, \"Son, you can't stay here\"\nI say, \"There's someone I'm waiting for\nIf it's a day, a month, a year\"\nGotta stand my ground, even if it rains or snows\nIf she changes her mind, this is the first place she will go\n\n[Chorus]\n'Cause if one day you wake up, and find that you're missing me\nAnd your heart starts to wonder where on this Earth I could be\nThinking maybe you'll come back here to the place that we'd meet\nAnd you'll see me waiting for you, on the corner of the street\nSo I'm not moving\nI'm not moving\nI'm not moving\nI'm not moving\n\n[Bridge]\nPeople talk about the guy who's waiting on a girl, oh\nThere are no holes in his shoes, but a big hole in his world, mmm\nAnd maybe I'll get famous as the man who can't be moved\nAnd maybe you won't mean to, but you'll see me on the news\nAnd you'll come running to the corner 'cause you know it's just for you\nI'm the man who can't be moved\nI'm the man who can't be moved\n\n[Chorus]\n'Cause if one day you wake up, and find that you're missing me (find you're missing me)\nAnd your heart starts to wonder where on this Earth I could be (oh, where on Earth I could be)\nThinking maybe you'll come back here to the place that we'd meet (to the place that we'd meet, oh, oh)\nAnd you'll see me waiting for you, on the corner of the street (on the corner of the street)\nSo I'm not moving\n\n[Chorus]\n'Cause if one day you wake up, and find that you're missing me (I'm not moving)\nAnd your heart starts to wonder where on this Earth I could be (I'm not moving)\nThinking maybe you'll come back here to the place that we'd meet (I'm not moving)\nAnd you'll see me waiting for you, on the corner of the street\n\n[Outro]\nGoing back to the corner\nWhere I first saw you\nGonna camp in my sleeping bag\nI'm not gonna move\n\n.........\n Contact / Demo Submissions: contact@7clouds.org\n.........\n Demos / Music Submissions: https://7clouds.portal.district.biz\n.........\n Licensing / Sync Requests for 7clouds Releases: licensing@7clouds.org\n.........\n\n#thescript #themanwhocantbemoved #lyrics #7clouds","commandRuns":[{"startIndex":53,"length":23,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBcQ040EGAUiEwi_nZmzufOOAxXP_U8IHew0KmhI-oao5PHS87lc","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbXI2LUJaTFJ6OVpsN3ZRYzVtaW5JSWJmQnJxQXxBQ3Jtc0tuUTIyWjBDQUpfRExvQS1rRlNXQ2t0LUs2bTlkeWY1a2FNcXZrcmFJV0dCTVR1TzhxcXhRRTc1UmJZZTR3OERPNkd4Ui1Wb1JNcmtERk1ia
